import React from 'react';
import { Link } from 'react-router-dom';
import GoogleAuth from './GoogleAuth';
import SearchBar from './SearchBar';

const Header = () => {
    return (
        <div className="ui pointing menu">
            <Link to="/" className="logo">
                 elrim.
            </Link>
            <SearchBar/>
            <div className="menu">
                <Link to="/" >
                    Browse
                </Link>
                <Link to="/" >
                    Profile
                </Link>
                <GoogleAuth />
            </div>
        </div>
    )
}

export default Header;
